import React from "react";
import ReactDOM from "react-dom";


function Card(props) {
  return (
    <div>
      <h2>{props.name}</h2>
      <img
        src={props.img}
        alt="avatar_img"
      />
      <p>{props.tel}</p>
      <p>{props.email}</p>
    </div>
  );
}


ReactDOM.render(
  <div>
    <h1>My Contacts</h1>
    <Card
      name="Beyonce"
      img="https://blackhistorywall.files.wordpress.com/2010/02/picture-device-independent-bitmap-119.jpg"
      tel="+123 456 789"
      email="b@beyonce.com"
    />
    <Card name="" img="https://www.google.com/imgres?imgurl=https%3A%2F%2Fwww.thefamouspeople.com%2Fprofiles%2Fimages%2Fkatt-williams-4.jpg&imgrefurl=https%3A%2F%2Fwww.thefamouspeople.com%2Fprofiles%2Fkatt-williams-30191.php&tbnid=EUSCpmKdnElsNM&vet=12ahUKEwiWvsrfltf5AhVQrXIEHf2zBWQQMygGegUIARDOAQ..i&docid=GnQ9qQ84vqmXTM&w=900&h=750&q=free%20katt%20williams%20images&hl=en&ved=2ahUKEwiWvsrfltf5AhVQrXIEHf2zBWQQMygGegUIARDOAQ" tel="" email="" />

    <input id="fName" />

  </div>,
  document.getElementById("root")
);
